import React, { useState } from 'react';
import './App.css';

function App() {
  const [file, setFile] = useState(null);
  const [loading, setLoading] = useState(false);
  const [paperAnalysis, setPaperAnalysis] = useState(null);
  const [currentSectionIndex, setCurrentSectionIndex] = useState(0);

  const handleFileUpload = (event) => {
    const uploadedFile = event.target.files[0];
    setFile(uploadedFile);
  };

  const analyzePaper = async () => {
    setLoading(true);
    try {
      const formData = new FormData();
      formData.append('file', file);

      const response = await fetch('http://localhost:5000/analyze-paper', {
        method: 'POST',
        body: formData,
      });
      const data = await response.json();
      setPaperAnalysis(data);
      setCurrentSectionIndex(0);
    } catch (error) {
      console.error('Error analyzing paper:', error);
    }
    setLoading(false);
  };

  const goToNextSection = () => {
    if (currentSectionIndex < paperAnalysis.sections.length - 1) {
      setCurrentSectionIndex(currentSectionIndex + 1);
    }
  };

  const goToPreviousSection = () => {
    if (currentSectionIndex > 0) {
      setCurrentSectionIndex(currentSectionIndex - 1);
    }
  };

  return (
    <div className="App">
      <div className="content">
        <div className="header-section">
          <h1>Research Paper Analyzer</h1>
          <p className="subtitle-text">Make research papers accessible and interactive</p>
        </div>

        {!paperAnalysis ? (
          <div className="upload-section">
            <div className="file-upload-container">
              <input
                type="file"
                onChange={handleFileUpload}
                accept=".pdf"
                id="file-upload"
                className="file-input"
              />
              <label htmlFor="file-upload" className="file-label">
                {file ? file.name : 'Choose a research paper (PDF)'}
              </label>
            </div>
            <button 
              onClick={analyzePaper}
              disabled={loading || !file}
              className={`analyze-button ${loading ? 'loading' : ''}`}
            >
              {loading ? (
                <>
                  <span className="spinner"></span>
                  <span>Analyzing paper...</span>
                </>
              ) : (
                'Analyze Paper'
              )}
            </button>
          </div>
        ) : (
          <div className="analysis-container">
            <div className="navigation-controls">
              <button 
                onClick={goToPreviousSection}
                disabled={currentSectionIndex === 0}
                className="nav-button"
              >
                ← Previous
              </button>
              <span className="section-counter">
                Section {currentSectionIndex + 1} of {paperAnalysis.sections.length}
              </span>
              <button 
                onClick={goToNextSection}
                disabled={currentSectionIndex === paperAnalysis.sections.length - 1}
                className="nav-button"
              >
                Next →
              </button>
            </div>

            <div className="section-content">
              <h2>{paperAnalysis.sections[currentSectionIndex].title}</h2>

              <div className="section-original">
                <h3>Original Text</h3>
                <div className="text-content">
                  {paperAnalysis.sections[currentSectionIndex].originalText}
                </div>
              </div>

              <div className="section-summary">
                <h3>Summary</h3>
                <div className="text-content">
                  {paperAnalysis.sections[currentSectionIndex].summary}
                </div>
              </div>

              <div className="section-references">
                <h3>Related Topics & References</h3>
                <ul>
                  {paperAnalysis.sections[currentSectionIndex].references.map((ref, index) => (
                    <li key={index}>
                      <a href={ref.url} target="_blank" rel="noopener noreferrer">
                        {ref.title}
                      </a>
                      <p>{ref.description}</p>
                    </li>
                  ))}
                </ul>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default App;
